" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Clinical features, diagnosis, staging, and treatment of uterine carcinosarcoma",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?43/34/44585/contributors\">",
